description:
This is the full installer for the Half-Life 1 mod Master Sword Continued

This is a multi-player RPG style game that allows you create and save you&amp;#039;re own character.

There is also a master server for the game that saves your online character.  It doesn&amp;#039;t matter what server you play in, so long as the server you play in is connected to the master server, you can play your saved character.

